from Crypto.Cipher import DES
import base64
from urllib.parse import unquote_plus, quote
import re

Key = "4d3ce191".encode('utf-8')

#加密
def encrypt_des(cipher):
    # ECB方式
    cipher = quote(cipher)
    generator = DES.new(Key, DES.MODE_ECB)
    pad = 8 - len(cipher) % 8
    pad_str = ""
    for i in range(pad):
        pad_str = pad_str + chr(pad)

    # 加密
    encrypted = generator.encrypt(cipher.encode('utf-8') + pad_str.encode('utf-8'))
    # 编码得密文
    result = base64.b64encode(encrypted)
    return quote(result)


# 解密
def decrypt_des(encrypted):
    generator = DES.new(Key, DES.MODE_ECB)
    # 解码
    crypted_str = base64.b64decode(encrypted)
    # 解密
    result = generator.decrypt(crypted_str).decode()
    aes_text = re.compile('[\\x00-\\x08\\x0b-\\x0c\\x0e-\\x1f\n\r\t]').sub('', result)
    end_data = unquote_plus(aes_text)

    return end_data


if __name__ == '__main__':
    data = decrypt_des('')
    print(data)
